import React, { Component } from 'react'
import Head from './Head'
import Login from './Login'
import MassageAdmin from '../Components/MassageAdmin'
import { CookiesProvider, withCookies } from 'react-cookie'
class Monitor extends Component {
    constructor() {
        super()
        this.state = {
            loginStat: false,
            page: "1",
            ren: <html></html>
        }
    }


    propsMomitor(e) {
        console.log(e)
        let pagesLogin = e,
            pageNumber = this.state.page
        if (pagesLogin === false) {
            this.setState({
                ren: <div><Login /></div>
            })
        } else if (pagesLogin === true && pageNumber === "1") {
            this.setState({
                ren: <div><MassageAdmin /></div>
            })
        }
    }

    componentWillReceiveProps(e) {
        console.log(e)
    }
    render() {
        return (
            <div>
                <CookiesProvider>
                    <Head toMonitor={this.propsMomitor} />
                    {this.state.loginStat}
                    {this.state.ren}
                </CookiesProvider>
            </div>
        )
    }
}

export default withCookies(Monitor)
